Early Access Review

In this game: HOLY ♥♥♥♥ I'M GOD OF HEADSHOTS
In CS:GO: Holy ♥♥♥♥ when i will kill someone? ;-;

Early Access Review

This game could be really good if they just worked on some things for it;
******THESE ARE BASED OFF MY EXPEREINCE WITH THE GAME AND BASED ON MY OPINIONS I'VE RECEIVED AFTER PLAYING.******

#1 - Better weapon balancing/More info on the weapons we use;
Some guns are just better to choose over other in every possible situation you get stuck in, and some are just overall useless. Along with these weapons being oddly balanced, it doesn't properly show you any stats on weapons, if it does at all. It'd be nice to see what guns does what, without having to waste the money earned from killing enemies with a starter gun.

#2 - Bigger maps;
Tight inclosed areas with little to no room gets old fast, something like Catacombs or that other outside jungle map are good ones, but #3 is another reason before those can happen.

#3 -Better spawn placement;
Spawning shouldn't be a hassle to deal with enemies when you JUST spawn. I should be able to spawn in a different area, instead of one or two different spawns which are being spawncamped, or if not, make unaccessable spawns to the enemies with different areas to leave your spawn from, like how it is in a few different games, mostly referencing Team Fortress 2. Different spawns, usually, with different exits that would make it harder to get spawncamped.

#4 - Better, visually noticable spawn protection;
If you don't do better spawns, like how above states, you could just make the spawn protection better. It gets annoying when someone leaves spawn, sprinting and guns blazing, and you can't really do anything about it cause they're spawn protected and you don't know. Something like CS:Go's Deathmatch would be nice, how you can see enemies are spawn protected by making them somewhat transparent.

#5 - Different gamemodes;
I'd highly recommend some sort of large area arena or bomb planting gamemodes. Doing the same, kill enemies, get different guns will get old fast, so adding variety towards this would make more people want to play.

#6 - Some sort of healthpack/ammo system, or some way to get health/ammo back;
The reason I say this is cause it feels wrong to have a game like this, and have no way to get health back. This is a game that feels based on luck, who has more health and armor in your encounter, and who has the gun that kills instantly. Atleast with some sort of way to get healed and get ammo, it'd give more chances to stay alive and actually enjoy the game.

#7 - More weapons/content!;
Sure, this may sort of stray away from my ideas, but some new stuff for this game would be amazing! Like, making some different grenade types, like flashbangs or something, or even some different melee types or whatever sounds good. I'd personally love to see some throwing knives or even some explosive traps or something.

#8 - Anti-Cheat.
This one really shocks me.
I don't understand why there is hacking for this game ALREADY, when it's so young and fresh.
It ruins the fun for everyone when a player gets in ANY game and starts to cheat, so why would we let them in this game? I say, a good anti-cheat would make this part of the game, a lot better for all.

#9 - Better hit detection;
This one is the last thing I really need to mention, but a lot of the time I feel as if I'm shooting dead center, and it feels off, and knifing people is basically impossible while sprinting or doing literally anything moving and knifing. It may be hit detection or something else, but for now, I don't know, and it feels really weird sometimes.



That said, THAT'S NOT TO SAY THAT THIS GAME IS BAD, it's surprisingly enjoyable for all of the lacking things this game gives, and there is still time for improvement, seeing how this is an Early Access game.

I'd love to see more done with this game, seeing how enjoyable it is at it's current state.
Oh, also, maybe some US Servers would be nice, hehe.

